void draw_line(int x0, int y0, int x1, int y1, short int line_colour){
	
	bool is_steep = abs(y1-y0) > abs(x1-x0);
	if (is_steep){
		swap(&x0,&y0);
		swap(&x1,&y1);
	}
	if (x0 > x1){
		swap(&x0,&x1);
		swap(&y0,&y1);
	}
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax / 2);
	int y = y0;
	//int y_step = (y0 < y1) ? 1 : -1;
	int y_step = 1;
		if (y0 < y1){
			 y_step = 1;
		}else{
			 y_step = -1;
		}

	for (int x = x0; x <= x1; x++){
		if (is_steep){
			plot_pixel(y,x,line_colour);
		}else{
			plot_pixel(x,y,line_colour);
		}
		error = error + deltay;
		if(error > 0){
			y = y + y_step;
			error = error - deltax;
		}
	
	}
}
void swap(int* x, int *y){
	int temp = *x;
	*x = *y;
	*y = temp;
	    

}
